// HomePage.js
import React from 'react';

const HomePage = () => (
  <div>
    <h1>Welcome</h1>
    <h3>Measure User Emotions During Multimedia Interaction: Valence and Arousal Reporting</h3>
    <div>
      <p></p>
      <button className="App-button" onClick={() => { window.location.href = "/consent"; }}>
        Start
      </button>
    </div>
  </div>
);

export default HomePage;
